class Login extends Component{
  render(){
    return(
      <form>
        <div className= "login_form">
        <label>Email</label>
        <input type="name">Enter the email</input>
        <label>Password</label>
        <input type= "password">Enter the password</input>
        <button></button>
        </div>

      </form>
    )
  }
}

export default Login
